import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { RecoilRoot } from 'recoil';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

// Components
import CourseTable from "./pages/table/CourseTable.js";
import Header from "./pages/PageHeader.js";
import TableFilter from "./pages/table/TableFilter.js";
import ChosenCourses from "./pages/chosen/ChosenCourses";

ReactDOM.render(
  <React.StrictMode>
    <RecoilRoot>
    <Router>
    <Header/>
    <Route path="/" element={<CourseTable />} />
    <Route path="/chosen" element={<ChosenCourses />} />
    </Router>
    </RecoilRoot>
  </React.StrictMode>,
  document.getElementById("root")
);
